import React from "react";

const chats = [
    {
        id: 1,
        title: 'M-Video'
    },        
    {
        id: 2,
        title: 'Mobilon'
    },
    {
        id: 3,
        title: 'Lenta'
    },
];

const Chats = (props) => {
    return(
        <ul className="list-group">
        {chats.map(chat => <li>chat.title</li>)}
        </ul>
    );
}

export default Chats;
